}


int solveRoomSeven(const char* input) {
    // Check if the input matches the solution for room 7
    if (strcmp(input, "solution for room 7") == 0) {
        return 1; // Riddle solved
    } else {
        return 0; // Riddle not solved
    }
}

int solveRoomSix(const char* input) {
    // Check if the input matches the solution for room 7
    if (strcmp(input, "solution for room 6") == 0) {
        return 1; // Riddle solved
    } else {
        return 0; // Riddle not solved
    }
}

int main() {
    // Initialize BASS
    if (!BASS_Init(-1, 44100, 0, 0, NULL)) {
        printf("Error initializing BASS library: %d\n", BASS_ErrorGetCode());
        return 1;
    }

    // Play background music
    playMusic("sound/eddie.mp3");

    // Display the introductory text
    readTextFile("data/OP1.txt");

    // Game loop
    while (1) {
        // Get user input
        char input[MAX_LINE_LENGTH];
        fgets(input, MAX_LINE_LENGTH, stdin);

        // Remove the newline character from the input
        input[strcspn(input, "\n")] = '\0';

        // Process user input
        if (strcmp(input, "quit") == 0) {
            break; // Exit the game loop
        } else {
            int currentRoom = 7; // Assuming the player starts in room 7
            int isRiddleSolved = 0;

            switch (currentRoom) {
                case 7:
                    isRiddleSolved = solveRoomSeven(input);
                    break;
                case 6:
                    isRiddleSolved = solveRoomSix(input);
                    break;
                // Add cases for other rooms here
                default:
                    printf("Invalid room number.\n");
                    break;
            }

            if (isRiddleSolved) {
                currentRoom--;
                if (currentRoom == 1) {
                    printf("Congratulations! You have escaped the rooms and the building!\n");
                    break; // Exit the game loop
                } else {
                    printf("You have solved the riddle and can proceed to the next room.\n");
                    // Display the text file for the next room
                    char nextRoomFile[MAX_LINE_LENGTH];
                    snprintf(nextRoomFile, MAX_LINE_LENGTH, "data/room%d.txt", currentRoom);
                    readTextFile(nextRoomFile);
                }
            } else {
                printf("Incorrect answer. Try again.\n");
            }
        }

      
    }

    // Free BASS resources
    stopMusic();
	freeMusic();

    return 0;
}



void readTextFile(const char* filename) {
    FILE* file = fopen(filename, "r");
    if (file == NULL) {
        printf("Error opening file: %s\n", filename);
        return;
    }

    char line[MAX_LINE_LENGTH];
    while (fgets(line, MAX_LINE_LENGTH, file)) {
        printf("%s", line);
    }

    fclose(file);
}

